        return (
            <div>
               <div className="card">
                   <div className="card-body">
                       <h3>Good morning</h3>
                       <h5>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Explicabo laborum numquam omnis perferendis, possimus quae quibusdam reiciendis. Commodi delectus fugiat perferendis quia repellat? Animi natus praesentium provident quasi quia saepe.</h5>
                   </div>
               </div>
            </div>
        );
    }

}

export default ClassCard;
